        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eAll rights reserved.\n\u003c/p\u003e\u003cp\u003eRedistribution and use in source and binary forms, with or without modification, are permitted\n provided that the following conditions are met:\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e Redistributions of source code must retain the above copyright notice, this list of\n     conditions and the following disclaimer.  \n     * Redistributions in binary form must reproduce the above copyright notice, this list of\n     conditions and the following disclaimer in the documentation and/or other materials provided\n     with the distribution.\n\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eTHIS SOFTWARE IS PROVIDED BY THE COPYRIGHT HOLDERS AND CONTRIBUTORS \u003ca\u003eAS IS\u003c/a\u003e AND ANY EXPRESS OR\n  IMPLIED WARRANTIES, INCLUDING, BUT NOT LIMITED TO, THE IMPLIED WARRANTIES OF MERCHANTABILITY AND\n  FITNESS FOR A PARTICULAR PURPOSE ARE DISCLAIMED. IN NO EVENT SHALL THE COPYRIGHT OWNER OR\n  CONTRIBUTORS BE LIABLE FOR ANY DIRECT, INDIRECT, INCIDENTAL, SPECIAL, EXEMPLARY, OR\n  CONSEQUENTIAL DAMAGES (INCLUDING, BUT NOT LIMITED TO, PROCUREMENT OF SUBSTITUTE GOODS OR\n  SERVICES; LOSS OF USE, DATA, OR PROFITS; OR BUSINESS INTERRUPTION) HOWEVER CAUSED AND ON ANY\n  THEORY OF LIABILITY, WHETHER IN CONTRACT, STRICT LIABILITY, OR TORT (INCLUDING NEGLIGENCE OR\n  OTHERWISE) ARISING IN ANY WAY OUT OF THE USE OF THIS SOFTWARE, EVEN IF ADVISED OF THE\n  POSSIBILITY OF SUCH DAMAGE.\n\u003c/p\u003e\u003cp\u003emonad-param Maintainer  :  Edward Kmett \u003ca\u003eekmett@gmail.com\u003c/a\u003e\n Bind.Marshal Maintainer  :  Corey O'Connor \u003ca\u003ecoreyoconnor@gmail.com\u003c/a\u003e\n Stability   :  experimental\n Portability :  non-portable (requires the kitchen sink)\n\u003c/p\u003e\u003cp\u003eImplements a notion of parameterized monad by varying the monad itself, this lets us avoid having\n to carry a parameter around for monads that do not need it, and we can rederive the normal notion\n of a parameterized monad from this variation for those that do.  The signature of \u003ccode\u003e\u003ca\u003e\u003e\u003e=\u003c/a\u003e\u003c/code\u003e costs us\n type inference for the types of \u003ccode\u003e\u003ca\u003ereturn\u003c/a\u003e\u003c/code\u003e and \u003ccode\u003e\u003ca\u003emzero\u003c/a\u003e\u003c/code\u003e, so we restore that by defining \u003ccode\u003e\u003ca\u003ereturn\u003c/a\u003e\u003c/code\u003e as\n the unit of the \u003ccode\u003e\u003ca\u003eIdentity\u003c/a\u003e\u003c/code\u003e monad and \u003ccode\u003e\u003ca\u003emzero\u003c/a\u003e\u003c/code\u003e as the unit of the trivial bottom monad, and\n appealing to the monad laws to allow these to combine with all other monads satisfying the monad\n laws through \u003ccode\u003e\u003ca\u003e\u003e\u003e=\u003c/a\u003e\u003c/code\u003e\n\u003c/p\u003e\u003cp\u003eThis imports and defines the correct instances for a good portion of the \u003ccode\u003emonads-tf\u003c/code\u003e, primarily\n because it is so awkward to import them all otherwise due to the fact that most of them re-export\n the \u003ccode\u003eControl.Monad.Monad\u003c/code\u003e syntax.  Does not export \u003ca\u003eControl.Monad.ST\u003c/a\u003e or \u003ca\u003eControl.Monad.Writer\u003c/a\u003e\n since it is unclear if you want strict or lazy versions in scope\n\u003c/p\u003e\u003c/div\u003e",
        "fct-module": "Bind.Marshal.Control.Monad.Parameterized",
        "fct-package": "bind-marshal",
        "fct-signature": "module",
